S U R V I V E.&amp;ldquo;Michael and I have known each other since we were 13, I think,&amp;rdquo; says Kyle Dixon, one-quarter of the Austin, TX synthwave band S U R V I V E.
&amp;ldquo;We met at the skate park,&amp;rdquo; says Michael Stein, another quarter. &amp;ldquo;Kyle had JNCO pants on and a Wu-Tang necklace.&amp;rdquo;
&amp;ldquo;Wu-Tang,&amp;rdquo; Dixon adds. &amp;ldquo;Yeah, Wu-Tang.&amp;rdquo;
Dixon and Stein have the kind of nonchalant rapport you&amp;rsquo;d expect from two old friends, and are as relaxed and unphased as a band suddenly catapulted into cult-stardom can be. It&amp;rsquo;s been a week since the premiere of Stranger Things, Netflix&amp;rsquo;s retro-horror show starring Winona Ryder for which S U R V I V E provide the soundtrack, and in record time the series has become an object of Internet obsession. The show&amp;rsquo;s deft assimilation of Reagan-era pop artifacts, its endearingly awkward preteen cast members, its stylish cinematography and, of course, its stunning score, all became a national obsession&amp;mdash;if not overnight, then at least over the course of a weekend.

&amp;ldquo;I&amp;rsquo;ve known [fellow S U R V I V E synth player] Adam [Jones] and Michael about the same length of time,&amp;rdquo; says Dixon. &amp;ldquo;I played tee-ball with Adam.We ended up going to college together and living together. And then we met [synth player] Mark [Donica], who is the fourth member of the band.&amp;rdquo;
That a group of childhood friends would score a story about a group of childhood friends is a Hollywood-ready tale in its own right, but that the score suddenly propelled a band that had been toiling in obscurity to sudden and much-deserved fame makes the entire affair that much richer. Rarely does a national conversation about a television show focus heavily on the composers, but Stranger Things and its score are anything but typical. From the first moment of the title sequence, with its Stephen King-on-VHS graphics and tense, pulsing synthesizers, the viewer is aware that score is a character in its own right, not just background noise.

S U R V I V E.&amp;ldquo;The [Duffer Brothers, the show&amp;rsquo;s creators] found our music somehow,&amp;rdquo; Dixon says. &amp;ldquo;I don&amp;rsquo;t really know how they found it. They&amp;rsquo;d used a song of ours in a little mock trailer that they made to finish the concept pitch. I guess through pitching that, and it being successful, they decided to reach out to see if we were available to do more music for them. Of course, we said &amp;lsquo;Yes.&amp;rsquo;&amp;rdquo;
&amp;ldquo;I mean, it&amp;rsquo;s unbelievable,&amp;rdquo; says Stein, sounding a bit dumbfounded. &amp;ldquo;It&amp;rsquo;s crazy that it got set up mostly because we make essentially cinematic music on our records. That just kind of paved the way for [the score].&amp;rdquo;

The group&amp;rsquo;s productivity also put them at a distinct advantage. &amp;ldquo;We record music all the time,&amp;rdquo; Dixon explains. So we have hours and hours of stuff that&amp;rsquo;s never come out, or is never going to come out. The fact that we had that library sitting around when the Duffer Brothers reached out was very instrumental in helping us land the deal. They basically asked if we had any more stuff, and we sent them 50&amp;nbsp;tracks the next day.&amp;rdquo;
The band&amp;rsquo;s relationship with Relapse Records&amp;mdash;the legendary Philadelphia rock label that has been branching out into stranger, more psychedelic, metal-adjacent realms as of late&amp;mdash;is also the result of a friendship. Timmy Hefner&amp;mdash;organizer of&amp;nbsp;the late, lamented Chaos in Tejas punk festivals&amp;mdash;helped reissue the band&amp;rsquo;s debut LP. Hefner then passed the band&amp;rsquo;s music on to Relapse, and the rest is history.
S U R V I V E.The group&amp;rsquo;s Relapse debut,&amp;nbsp;RR7349, was announced just as Stranger Things hit the level of pop-culture phenomenon, and its lush, emotive sound design, tense rhythms and insistent melodies play as well to longtime synth snobs as they do to new initiates. Yes, an encyclopedic knowledge of Tangerine Dream album cuts and Popol Vuh B-Sides makes listening to RR7349 a joy. But that knowledge isn&amp;rsquo;t required to get maximum pleasure from the record.

One of the most exciting things about S U R V I V E&amp;rsquo;s sudden popularity and RR7349&amp;prime;s imminent arrival, is that it has operated as a gateway to the vast and awe-inspiring world of synth music for many who had never really given it much thought, pushing a scene and sound that has been bubbling under the collective consciousness for a long time into the limelight. For S U R V I V E, it&amp;rsquo;s a payoff years in the making.
&amp;ldquo;We were like, &amp;lsquo;This [Stranger Things opportunity]&amp;nbsp;is going to be cool,&amp;rsquo; but I was not expecting this,&amp;rdquo; says Dixon. &amp;ldquo;But I guess I&amp;rsquo;m not too surprised. I mean if I [was just someone who] found out about the show, I&amp;rsquo;d be stoked.&amp;rdquo;
&amp;mdash;&amp;nbsp;Sean Maloney&amp;nbsp;
